import React, { Component } from 'react'

export default class CancelBooking extends Component {
    render() {
        return (
            <div className="container ">
                <br/>
                <p className="text-center"> Cancel funtionality will be done here !</p>
                <br/>

                <button className="btn btn-danger col-lg-8 m-auto d-block ">CancelBooking</button>
            </div>
        )
    }
}
